apiVersion: bitnami.com/v1alpha1
kind: SealedSecret
metadata:
  name: spack-project-runner-registration-token
  namespace: gitlab
spec:
  encryptedData:
    # Token from: https://gitlab.spack.io/spack/spack/
    runner-registration-token: 
    runner-token: 
  template:
    metadata:
      annotations:
        kustomize.toolkit.fluxcd.io/reconcile: disabled
        sealedsecrets.bitnami.com/managed: "true"
---
apiVersion: bitnami.com/v1alpha1
kind: SealedSecret
metadata:
  name: spack-intermediate-ci-signing-key
  namespace: pipeline
spec:
  template:
    metadata:
      annotations:
        kustomize.toolkit.fluxcd.io/reconcile: disabled
        sealedsecrets.bitnami.com/managed: "true"
  encryptedData:
    bootstrap_gcc_key.pub: 
    e4s.gpg: 
    intermediate_ci_signing_key.gpg: 
    spack_public_key.gpg: 
